HQ very rare promo music video. &quot;Can't Buy Me Love&quot; is a song composed by Paul McCartney (credited to Lennon Ã¢â‚¬â€œ McCartney) and released by the Beatles on the A-side of their sixth British single, &quot;Can't Buy Me Love&quot;/&quot;You Can't Do That&quot;.

When pressed by American journalists in 1966 to reveal the song's &quot;true&quot; meaning, McCartney stated that &quot;I think you can put any interpretation you want on anything, but when someone suggests that 'Can't Buy Me Love' is about a prostitute, I draw the line.&quot; He went on to say: &quot;The idea behind it was that all these material possessions are all very well, but they won't buy me what I really want.&quot; However, he was to comment later: &quot;It should have been 'Can Buy Me Love' &quot; when reflecting on the perks that money and fame had brought him.

The song's verse is a twelve bar blues in structure, a formula that the Beatles seldom applied to their own material.

The Beatles were an English rock band formed in Liverpool in 1960. They became the most commercially successful and critically acclaimed act in the rock music era. The group's best-known lineup consisted of John Lennon, Paul McCartney, George Harrison, and Ringo Starr. Rooted in skiffle and 1950s rock and roll, the Beatles later utilized several genres, ranging from pop ballads to psychedelic rock, often incorporating classical and other elements in innovative ways. In the early 1960s, their enormous popularity first emerged as &quot;Beatlemania&quot;, but as their songwriting grew in sophistication, they came to be perceived by many fans and cultural observers as an embodiment of the ideals shared by the era's sociocultural revolutions. 
